import React, { Component } from 'react';
// import "./main.css"
class Register extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
           <div>
                <div className="container">
                  <h3>Create Fruget Account</h3>
                  <div className="formform">
                      <form action=""> 
                      <div style={{float:"left",padding:"10px",width:"50%"}}>
                      <label for="fname" >First Name </label>
				        <input type="text" id="fname" name="first_name" placeholder=""  className="form-control " style={{width:"100%"}}/>
                
                    </div>
                    <div style={{float:"left",padding:"10px",width:"50%"}}>
                    <label for="lname">Last Name</label>
				        <input type="text" id="lname" name="last_name" placeholder=" "  className="form-control" style={{width:"100%"}}/>
                
                    </div>
                    <div style={{float:"left",padding:"10px",width:"50%"}}>     
                    <label for="email">Email</label>      
				        <input type="text" id="email" name="email" placeholder=" "  className="form-control " style={{width:"100%"}}/>
                
                    </div>
                    <div style={{float:"left",padding:"10px",width:"50%"}}>
                    <label for="contact">Phone number</label>
				        <input type="text" id="contact" name="contact" placeholder=" "  className="form-control " style={{width:"100%"}}/>

                  <br/>  </div>
                    <div style={{padding:"10px",width:"50%"}}>
                      <label htmlFor="">Password</label>
             <div className="input-group">     
            
<input type="password" className="form-control" pattern="[a-zA-Z0-9/]+" title="<b>Must contain text and numbers</b>" name="password" id="password" placeholder=" " name="search" style= {{padding:"5px"}} />
                
       <span toggle="#password-field" className="fa fa-fw fa-eye field-icon toggle-password" style={{fontSize:"20px"}}></span>
                 </div>
                 </div>
                      </form>
                  </div>
                </div>
           </div>
         );
    }
}
 
export default Register;
